import React from 'react';

function Competence() {
    const Compet = [
        {
            title: 'Php',
            value: '80'
        },
        {
            title: 'Html',
            value: '90'
        },
        {
            title: 'Css',
            value: '70'
        },
        {
            title: 'JavaScript',
            value: '50'
        },
        {
            title: 'Bootstrap',
            value: '99'
        },
        {
            title: 'React',
            value: '50'
        },
        {
            title: 'Git',
            value: '70'
        },
        {
            title: 'NetBeans',
            value: '80'
        }

    ]
    return (
        <div className="container info">
            <h1>Competence</h1>
            <div className="row">
                <div className="col-md-6">
                    {
                        Compet.map((competence,index) => {
                            return(
                                <>
                                <div class="progress">
                            <div key={index} class="progress-bar progress-bar-striped" role="progressbar" style={{width: competence.value+'%'}} aria-valuenow={competence.value} aria-valuemin="0" aria-valuemax="100">{`${competence.title}  ${competence.value}% `}</div>
                                </div> <br />
                                </>
                            )
                        })
                    } 
                </div>
                <div className="col-md-6">
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '60%'}} aria-valuenow="60" aria-valuemin="0" aria-valuemax="100"> TypeScript   60%</div>
                    </div> <br />
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '85%'}} aria-valuenow="85" aria-valuemin="0" aria-valuemax="100"> Java SE  85%</div>
                    </div> <br />
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '50%'}} aria-valuenow="50" aria-valuemin="0" aria-valuemax="100"> Python  50%</div>
                    </div> <br />
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '60%'}} aria-valuenow="60" aria-valuemin="0" aria-valuemax="100"> Ocaml  60%</div>
                    </div> <br />
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '75%'}} aria-valuenow="75" aria-valuemin="0" aria-valuemax="100"> SQL/MySql  75%</div>
                    </div> <br />
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '40%'}} aria-valuenow="40" aria-valuemin="0" aria-valuemax="100"> Django  40%</div>
                    </div> <br />
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '90%'}} aria-valuenow="90" aria-valuemin="0" aria-valuemax="100"> phpMyadmin  90%</div>
                    </div> <br />
                    <div class="progress">
                        <div class="progress-bar progress-bar-striped" role="progressbar" style={{width: '50%'}} aria-valuenow="50" aria-valuemin="0" aria-valuemax="100"> Latex  50%</div>
                    </div> <br />
                </div>
            </div>
        </div>
    )
}

export default Competence;
